import React from 'react';

import './itom-list.css';

export default class ItomList extends React.Component {

state= {
   list:[]
}

componentDidMount(){
   this.getAllItomList();
}


getAllItomList = () => {
const getlist=this.props.setParamList;
getlist().then((rez)=>{
   this.setState({list:rez});
});
}

render(){ 
   const {usinItem} = this.props;
   let count =1; 
   console.log(this.state.list);
   const element = this.state.list.map((el)=>{
               const id = count++;
               const {name, eye_color} = el;
               return (
                   <li key ={id} className="list-group-item"
                       onClick={()=>usinItem(id)}
                       >{name} and {eye_color}</li>
               );
    });


   return(
          <ul className = "list-group zeal-test">
             {element}
         </ul>
   );
};
};
